import React from 'react'
import { useState} from 'react';
// import TradingViewWidget from 'react-tradingview-widget';
import TradingViewWidget, { Themes } from 'react-tradingview-widget';

export default function TradingTwo() {

// let trading = new TradingViewWidget("")
TradingViewWidget.symbol="BITSTAMP:BTCUSD"
TradingViewWidget.theme = 'Light'
TradingViewWidget.width = '900px'
TradingViewWidget.height = '900px'
TradingViewWidget.BarStyles='HEIKIN_ASHI'
TradingViewWidget.locale="en"
TradingViewWidget.interval="180"

return (
<div>
<h1> working widget</h1>

{/* <TradingViewWidget symbol="NASDAQ:AAPL" /> */}
<TradingViewWidget
    symbol="BITSTAMP:BTCUSD"
    // theme= "Light"
    // theme={Themes.DARK}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    // width='600px'
    height='280px'
    style='8'
    interval="180"
    // studies= "[RSI@tv-basicstudies]"            
  />

</div>
)
}
